
byte_code = ''
bin_buffer = ''

for index in range(0,len(byte_code),2):
    bytedata = byte_code[index] + byte_code[index + 1]
    data = int('0x%s' % (bytedata),16)

    bin_buffer += chr(data)

print(bin_buffer)
file = open('o.bin','wb')
file.write(bin_buffer.encode(encoding='UTF-8',errors='strict'))
file.close()
